const InputMain = ({ dispatch }: Props) => {
  return (
    <form
      onSubmit={(e: any) => {
        e.preventDefault();
        dispatch(addTodo(e.target.value));
      }}
    >
      <input placeholder="hey here"></input>
    </form>
  );
};

// const mapDispatchToStore = (dispatch)=>{
